import React from "react";
import { Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import MainPage from "./pages/MainPage";
import FundingGuidePage from "./pages/FundingGuidePage";
import AboutPage from "./pages/AboutPage";
import MyPage from "./pages/MyPage";
import LoginPage from "./pages/LoginPage";
import RegisterPage from "./pages/RegisterPage";

// 투자 관련 페이지들
import InvestmentGuidePage from "./pages/investment/GuidePage";
import InvestmentProcessPage from "./pages/investment/ProcessPage";
import InvestmentRiskPage from "./pages/investment/RiskPage";
import InvestmentReturnsPage from "./pages/investment/ReturnsPage";

// 예약 관련 페이지들
import BookingSearchPage from "./pages/booking/SearchPage";
import BookingPromotionsPage from "./pages/booking/PromotionsPage";
import BookingGuidePage from "./pages/booking/GuidePage";

const App = () => {
  return (
    <>
      <Navbar />
      <Routes>
        <Route path="/" element={<MainPage />} />
        <Route path="/funding-guide" element={<FundingGuidePage />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/mypage" element={<MyPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/register" element={<RegisterPage />} />

        {/* 투자 관련 라우트 */}
        <Route path="/info/guide" element={<InvestmentGuidePage />} />
        <Route path="/info/process" element={<InvestmentProcessPage />} />
        <Route path="/info/risk" element={<InvestmentRiskPage />} />
        <Route path="/info/returns" element={<InvestmentReturnsPage />} />

        {/* 예약 관련 라우트 */}
        <Route path="/booking/search" element={<BookingSearchPage />} />
        <Route path="/booking/promotions" element={<BookingPromotionsPage />} />
        <Route path="/booking/guide" element={<BookingGuidePage />} />
      </Routes>
    </>
  );
};

export default App;
